    <div>
      <form action="">
        <input
          type="text"
          onChange={handleChange}
          name="Uname"
          placeholder="Name..."
          value={Uname}
        />
        <input
          type="password"
          onChange={handleChange}
          name="password"
          placeholder="Password..."
          value={password}
        />
        <button>SignUp</button>
      </form>
    </div>
  );
};

